    "headlineNews": "Justin Herbert completed 25-of-38 passes for 222 yards and three touchdowns in the Chargers' 28-14, Week 4 win over the Raiders Monday night.\n",
    "report": "",
    "analysis": "Herbert did virtually all of his damage in the first half, going 20-of-25 for 175 yards and the three touchdowns before the break. Herbert's touchdowns all came in the red zone with four-, 10-, and 14-yard hookups to Donald Parham, Jared Cook, and Austin Ekeler. One throw Herbert would've liked to have back was a would-be 82-yard touchdown to Mike Williams that Herbert badly overthrew when CB Damon Arnette was absolutely roasted off the line. With the Chargers up just 21-14 in the fourth quarter, Herbert completed a 4th-and-2 throw to Jared Cook to keep the drive going and get Ekeler into the end zone again later to give the Chargers a lead they wouldn't relinquish after the momentum was tilting in the Raiders' favor. Herbert has a perfect 7:0 TD:INT mark in wins over the Chiefs and Raiders the last two weeks. The 3-1 Chargers host the Browns in Week 5.\n",
